import Vue from 'vue';
import VueRouter from 'vue-router';

// Import your views/components
import Home from '../views/Home-view.vue';
import About from '../views/About-view.vue';
import Service from '../views/Service-view.vue';
Vue.use(VueRouter);
const routes = [{
  path: '/',
  name: 'Home',
  component: Home
}, {
  path: '/about',
  name: 'About',
  component: About
}, {
  path: '/service',
  name: 'Service',
  component: Service
}];
const router = new VueRouter({
  mode: 'history',
  routes
});
export default router;
